import React from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
} from "mdb-react-ui-kit";

export default function Home() {
  return (
    <div className="card" style={{ width: "18rem" }}>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQuymf0DvAzw7vPonaZiBtc6bCTZLZlkopeVxVAoUoXnW88O-sYKxF7HFJOIkfR4xD9ErI&usqp=CAU" className="card-img-top" alt="..." />
      <div className="card-body">
        <h6 className="card-title">Login to see Bid Status</h6>
        <a href="#" className="btn btn-primary">
          Go somewhere
        </a>
      </div>
    </div>
    // <MDBCard>
    //   <MDBCardImage src='https://mdbootstrap.com/img/new/standard/nature/184.webp' position='top' alt='...' />
    //   <MDBCardBody>
    //     <MDBCardTitle>Card title</MDBCardTitle>
    //     <MDBCardText>
    //       Some quick example text to build on the card title and make up the bulk of the card's content.
    //     </MDBCardText>
    //     <MDBBtn href='#'>Button</MDBBtn>
    //   </MDBCardBody>
    // </MDBCard>
  );
}
